  return (
    <div className='relative'>
      <div className=''>
        <img className='w-full h-full rounded-3xl' src={guidance1} alt='' />
      </div>
      <div className='w-full h-full absolute top-0 bg-blue-200 opacity-50'></div>
    </div>
  );
};
